function Run(PNo){
  g_TurnAng = 36;
  // 移動
  g_MoveDir.Set(g_AtkTarData.vWay);
  local vX = CVector3();
  vX.Set(g_AtkTarData.vWayX);
  local dist = g_AtkTarData.Dist;
  vX.Scale(dist*0.2);
  g_MoveDir.Sub(vX);
  g_MoveDir.Normalize();

  g_Speed = 0.5;
  g_MoveFric = 0.93;

//  g_CalcBodyBaseRX.Mode_Homing_Add(0, 45,45,5,g_AtkTarData.lpTar);
  g_BodyBaseData.CalcStart(45,45,5);


  function Test()
  {
    g_MoveDir.Homing(g_AtkTarData.vWay,5);

    if(g_AtkTarData.Dist < 2 || g_AtkTarData.lpTar == 0){
      g_AnimeMgr[PNo].ChangeAnime(-1,13,0);
      g_Speed = 0.2;
      g_Sword.SetFunc(null);
      return 1;
    }
    return 0;
  }
  g_Sword.SetFunc(Test);

  return 0;
}

